import Link from "next/link";
const Menu = () => (
  <nav>
    <Link href="/">
      <a>Home Page</a>
    </Link>
    <Link href="/about">
      <a>About</a>
    </Link>
    <Link href="/products">
      <a>Product</a>
    </Link>
  </nav>
)

export default Menu;
